import * as React from 'react'
import { ISeo, INavigation } from '../interfaces'
import HeadTag from './HeadTag'
import NavigationBar from './NavigationBar';
type Props = {
  seo?: ISeo,
}
const navLinkList: INavigation[] = [
  { to: '/', label: 'Home' },
  { to: '/about', label: 'About' },
  { to: '/blog', label: 'Blog' },

]

const defaultSeo:ISeo={
  title:'Sanyam Arya',
  description:'This is Sanaym Arya',
  twitterDescription:'This is Sanyam Arya',
  keywords:['sanyam arya','super cool','awesome','iot','nodejs'],
  type:'website',
  url:'sanyamarya.io',
  image:'https://avatars1.githubusercontent.com/u/28115284?s=460&v=4'

}
const Layout: React.FunctionComponent<Props> = ({ children, seo = defaultSeo}) => (

  <div>
    <HeadTag seo={seo} />
    <NavigationBar navLinkList={navLinkList} />
    {children}
  </div>
)

export default Layout
